  `mobile` varchar(64) NOT NULL DEFAULT '' COMMENT '手机',
  `email` varchar(64) NOT NULL DEFAULT '' COMMENT '邮箱',
  `supplier_id` int(11) NOT NULL DEFAULT '1' COMMENT '供应商ID',
