  `enabled` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否启用，1，启用；0，禁用',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除，1、是，0、否',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `uqe_username` (`username`),
  UNIQUE KEY `uqe_code` (`code`),
  KEY `idx_is_delete` (`deleted`)
) ENGINE=InnoDB AUTO_INCREMENT=700 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='后台管理系统登录用户表';

