CREATE TABLE `bai_enums` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `biz` varchar(64) NOT NULL DEFAULT '' COMMENT '系统业务群; 为空表示默认(通用)业务群',
  `group` varchar(64) NOT NULL DEFAULT '' COMMENT '枚举分组; 为空表示单元素枚举(K-V)，不为空表示多元素枚举',
  `key` varchar(64) NOT NULL DEFAULT '' COMMENT '键,英文,一般用于检索',
  `text` varchar(64) NOT NULL DEFAULT '' COMMENT '名称,中文,一般用于显示，也可以用于检索',
  `value` varchar(4000) NOT NULL DEFAULT '' COMMENT '数据值,枚举或参数的值,一般存储比较大的数据',
  `sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `idx_modules_sort` (`sort`) USING BTREE,
  KEY `idx_modules_text` (`text`),
  KEY `idx_modules_code` (`key`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='后台管理系统功能模块表';

