/*Table structure for table `bai_modules` */

DROP TABLE IF EXISTS `bai_modules`;

CREATE TABLE `bai_modules` (
  `module_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `module_pid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父id',
  `text` varchar(64) NOT NULL DEFAULT '' COMMENT '显示名称',
  `code` varchar(64) NOT NULL DEFAULT '' COMMENT '编码',
  `type` varchar(32) NOT NULL DEFAULT '' COMMENT '模块类型。SYSTEM(子系统)、GROUP(模块组)、MODULE(应用模块)、FUNCTION(操作功能)',
  `url` varchar(255) NOT NULL DEFAULT '' COMMENT '模块URL,必须以“http://”或“/”开头，要么为空串。在url后面可以带“_blank”参数，表示在新的窗口打开；或“_self”参数，表示在当前窗口打开；或不加参数，表示在框架中打开；参数以空格分隔',
  `image` varchar(255) NOT NULL DEFAULT '' COMMENT '模块图标',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `expanded` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否展开',
  `sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`module_id`),
  UNIQUE KEY `uqe_modules_pid_text` (`module_pid`,`text`),
  KEY `idx_modules_sort` (`sort`) USING BTREE,
  KEY `idx_modules_text` (`text`),
  KEY `idx_modules_code` (`code`)
